import express from 'express';
import http from 'http';
import cors from 'cors';
import bodyParser from 'body-parser';
import Rooms from '../models/Rooms';
import database from '../database/index';
import "regenerator-runtime/runtime.js";
import {getWords, newUser} from './utils';
import path from 'path';

const socketIO = require('socket.io');
const port = process.env.PORT || 3001;

let app = express();
let server = http.Server(app);
let io = socketIO(server);


app.use(cors());
app.use(express.json());
app.use(express.static(path.join(__dirname, '../client/build')));

app.options("/*", function(req, res, next) {
  res.header('Access-Control-Allow-Origin', '*');
  res.header('Access-Control-Allow-Methods', 'GET,PUT,POST,DELETE,OPTIONS');
  res.header('Access-Control-Allow-Headers', 'Content-Type, Authorization, Content-Length, X-Requested-With');
  res.sendStatus(200);
});

app.all('*', function(req, res, next) {
  res.header("Access-Control-Allow-Origin", "*");
  next();
});

/*
 roomMap: {
  roomID: {
    spymasterHints: String[],
    colors: String[],
    words: String[],
    clicked: Boolean[],
    isRedTurn: Boolean,
    totalGameScore: [int, int],
    redScore: int
    blueScore: int,
    redSpy: String,
    blueSpy: String,
    users: {
      userID[]: {
        team: String,
        role: String,
        isHost: Boolean,
      }
    }
  }
 }
*/

const colors = ["red", "red", "red", "red", "red", "red", "red", "red", "blue", "blue", "blue", "blue",
"blue", "blue", "blue", "blue", "white", "white", "white", "white", "white", "white", "white", "white", "black"];

// let interval;

// app.get('/', (req, res) => {
